// import secondDog from "./img-react/dog-2.jpeg";
// import thirdDog from "./img-react/dog-3.jpeg";
const blogs = [
  {
    id: 1,
    image: <img src={require("./img-react/dog-1.jpeg")}></img>,
    date: "24 Jan 2024",
    bHeading: (
      <div>
        Finding your perfect <br /> dog breed
      </div>
    ),
  },
  {
    id: 2,
    image: <img src={require("./img-react/dog-1.jpeg")}></img>,
    date: "23 Jan 2024",
    bHeading: (
      <div>
        5 signs that it's time to <br /> change your dog's diet
      </div>
    ),
  },
  {
    id: 3,
    image: <img src={require("./img-react/dog-3.jpeg")}></img>,
    date: "21 Jan 2024",
    bHeading: (
      <div>
        Taking care of your <br /> dog's joints
      </div>
    ),
  },
];
export default blogs;
